import React from 'react'

const divStyle = {
	backgroundColor: "#eeeeee",
	padding: "30px",
	fontFamily: "Arial"
}

function ObjectVariabelCSS() {
  return (
	<div style={ divStyle }>
		<h1>Hello World 2022</h1>
	</div>
  )
}

export default ObjectVariabelCSS
